import React from "react";
import Wave from "../components/Wave/Wave";
import Navigation from "../components/Navigation/Navigation";

function bio() {
  return (
    <>
      <header aria-label="primary">
        <Navigation />
      </header>
      <Wave />
      <main>
        <section className="bio container">
          <h2 className="bio__title">&#128214; - Biography</h2>
          <p className="bio__para">
            Curious by nature, and business minded. I'm a self taught, 21 year
            old creative developer with a passion for creating things that live
            on the internet.
          </p>
        </section>

        <section className="skills"></section>
      </main>
      <Wave flipped={true} />
    </>
  );
}

export default bio;
